## Appendix A. ADO invariants for COlored Knotted GRAPHs

Here we recall two quantum invariants defined for colored knotted graphs, which is also known as the quantum spin network. The first one is the Kirillov-Reshetikhin invariant introduced in [6], which is a generalization of the colored Jones polynomial, and the second one is the ADO invariant, which is also related to quantum $s l_{2}$ as the colored Jones polynomial, but this invariant is defined for the case that the quantum parameter $q$ is a root of unity. The ADO invariant was introduced in [1] for knots and links, and generalized to colored knotted graphs in [4]. The colored Jones invariant $J_{N-1}(K)$ is equal to $(-1)^{N-1} \mathrm{ADO}_{N}(K)$, and is equal to $\mathrm{ADO}_{N}(K)$ for odd $N$, where all the components of $K$ are colored by $(N-1) / 2$. Here we compute $\mathrm{ADO}_{N}(K)$ instead of $J_{N-1}(K)$ to get the desired form of the invariant which fits to the investigation of the asymptitics of the invariant.
A.1. ADO invariant for colored knots and links. We use the following notations.

$$
\begin{aligned}
q^{a} & =\exp \left(\frac{\pi i a}{N}\right)(a \in \mathbb{C}), \quad\{a\}=q^{a}-q^{-a}, \quad\{a, k\}=\prod_{j=0}^{k-1}\{a-j\} \\
{\left[\begin{array}{l}
a \\
b
\end{array}\right] } & =\prod_{j=0}^{a-b-1} \frac{\{a-j\}}{\{a-b-j\}}(a-b \in\{0,1, \ldots, N-1\}) \\
t_{a} & =a(a+1-N)=\left(a-\frac{N-1}{2}\right)^{2}-\frac{(N-1)^{2}}{4}
\end{aligned}
$$

Let $\mathcal{U}_{q}\left(s l_{2}\right)$ be the quantum $s l_{2}$ at the $2 N$-th root of unity $q$ and let $V_{a}$ be the highest weight irreducible module with the highest weight $q^{a}$. For $a \in(\mathbb{C} \backslash \mathbb{Z} / 2) \cup(N \mathbb{Z}-1) / 2, \operatorname{dim} V_{a}=N$.

Let $K=K_{1} \cup K_{2} \cup \cdots \cup K_{\ell}$ be a $\ell$ component oriented link diagram whose components are labeled by $c_{1}, \cdots, c_{\ell}$ where $c_{i} \in(\mathbb{C} \backslash \mathbb{Z} / 2) \cup(N \mathbb{Z}-1) / 2$. The label $c_{i}$ is called the color of the $i$-th component $K_{i}$. Let $T_{K}$ be a $(1,1)$ tangle obtained by cutting the $j$-th component of $K$. Then, by assigning the quantum $R$ matrix to the crossings, evaluation map to the maximal points and coevaluation map to the minimal points given in [4], we get a

scalar matrix of size $N$. This scalar depends on the color $c_{j}$ for the $j$ th component, and by multiplying $\left[\frac{2 c_{j}+N}{2 c_{j}+1}\right]^{-1}$, we get the ADO invariant $\mathrm{ADO}_{N}\left(K^{c_{1}, \cdots, c_{q}}\right)$ corresponding to the blackboard framing of $K$. Especially, the framings of a link diagram $K$ are all zero, them $\mathrm{ADO}_{N}\left(K^{c_{1}, \cdots, c_{q}}\right)$ is a link invariant of $K$.
A.2. ADO invariant for colored knotted graphs. By introducing operators corresponding to trivalent vertices, the ADO invariant is generalized to colored knotted graphs as in [4]. The ADO invariant is defined for a root of unity $q=e^{2 \pi i / N}$ and the colors assigned to edges must contained in $(\mathbb{C} \backslash \mathbb{Z} / 2) \cup N \mathbb{Z} / 2$. In the following, we sometimes consider colors in $\mathbb{Z} / 2$, and in such case, the corresponding invariant is considered to be a limit of the invariants with non-half-integer colors. Usually, such limit diverges, but sometimes it converges.

