2 c+1
\end{array}\right]^{-1} \mathrm{ADO}_{N}\left(\underbrace{a}_{-} \underbrace{c}_{-} \underbrace{a}_{-}\right), \\
& \mathrm{ADO}_{N}\left(\underbrace{a}_{-} \bigcirc \bigcirc\right)=q^{2 t_{a}} \mathrm{ADO}_{N}\left(\ldots \underbrace{a}_{-} \ldots\right) \text {, } \\
