Lemma A.1. We can remove a circle around an edge as follows.

$$
\begin{aligned}
& \mathrm{ADO}_{N}\left(\underbrace{a}_{-} \underbrace{a}_{-}\right)= \\
& i^{N-1} q^{(2 a+1-N)(2 b+1-N)}\{2 a+N, N-1\} \mathrm{ADO}_{N}(\ldots \underbrace{a}_{-} \ldots)
\end{aligned}
$$

Proof. The lefthand side of the formula is computed as follows.

$$
\begin{aligned}
& \mathrm{ADO}_{N}\left(\underbrace{a}_{-} \underbrace{a}_{-}\right) \underbrace{}_{(26)} \\
& \sum_{a+b-c=0,1, \cdots, N-1}\left[\begin{array}{l}
2 c+N \\
2 c+1
\end{array}\right]^{-1} \mathrm{ADO}_{N}\left(\underbrace{a}_{-} \underbrace{c}_{-} \underbrace{a}_{-}\right) \\
& \stackrel{2 \infty}{=} \sum_{k=0}^{N-1} q^{2\left(t_{a+b-k}-t_{a}-t_{b}\right)}\left[\begin{array}{l}
2(a+b-k)+N \\
2(a+b-k)+1
\end{array}\right]^{-1} \mathrm{ADO}_{N}\left(\underbrace{a}_{-} \underbrace{a}_{-} \underbrace{a}_{-}\right)
\end{aligned}
$$

$$
\begin{aligned}
& =\frac{\{N-1\}!q^{-t_{a}-t_{b}}}{\{2(a+b)+N\} \cdots\{2(a+b)+1\}} \times \\
& \sum_{k=0}^{N-1}\{2(a+b-k)+1\} q^{t_{a+b-k}} \mathrm{ADO}_{N}\left(\overbrace{0}^{a+b-k} \overbrace{0}^{a+b-k} a\right) \\
& \stackrel{\text { (25) }}{\equiv} \frac{\{N-1\}!q^{-t_{a}-t_{b}}}{\{2(a+b)+N\} \cdots\{2(a+b)+1\}}\left[\begin{array}{l}
2 a+N \\
2 a+1
\end{array}\right] \times \\
& =\frac{q^{-t_{a}-t_{b}}\{2 a+N, N-1\}}{\{2(a+b)+N, N\}} \times \\
& \sum_{k=0}^{N-1}\{2(a+b-k)+1\} q^{t_{a+b-k}} \mathrm{ADO}_{N}\left(\cdots \underset{\alpha}{\alpha} \cdots\right) .
\end{aligned}
$$

Now we compute

$$
\begin{aligned}
& \sum_{k=0}^{N-1}\{2(a+b-k)+1\} q^{t_{a+b-k}} \\
& =\sum_{k=0}^{N-1}\left(q^{2(a+b-k)+1}-q^{-2(a+b-k)-1}\right) q^{2\left(\left(a+b-k-\frac{N-1}{2}\right)^{2}-\frac{(N-1)^{2}}{4}\right)} \\
& =-q^{-\frac{(N-1)^{2}}{2}} \sum_{k=0}^{N-1}\left(q^{2(a+b-k)+1-N}-q^{-2(a+b-k)-1+N}\right) q^{\frac{1}{2}(2(a+b-k)+1-N)^{2}} \\
& =-q^{-\frac{(N-1)^{2}}{2}} \sum_{k=0}^{N-1}\left(q^{\frac{1}{2}(2(a+b-k)+2-N)^{2}-\frac{1}{2}}-q^{\frac{1}{2}(2(a+b-k)-N)^{2}-\frac{1}{2}}\right) \\
& =-q^{-\frac{(N-1)^{2}+1}{2}}\left(q^{2(a+b+1-N+\frac{N}{2})^{2}}-q^{2(a+b+1-N-\frac{N}{2})^{2}}\right) \\
& =-q^{-\frac{(N-1)^{2}+1}{2}} \times \\
& \left(q^{2\left((a+b+1-N)^{2}+N(a+b+1-N)+\frac{N^{2}}{4}\right)}-q^{2\left((a+b+1-N)^{2}-N(a+b+1-N)+\frac{N^{2}}{4}\right)}\right) \\
& =q^{2 a^{2}+2 b^{2}+4 a b+4 a+4 b+1-4 N a-4 N b}\{2 N(a+b)\}
\end{aligned}
$$

Since

$$
\begin{aligned}
2 a^{2}+2 b^{2}+4 a b+4 a+4 b+1-4 N a- & 4 N b-2 t_{a}-2 t_{b}= \\
& (2 a+1-N)(2 b+1-N)-N^{2}
\end{aligned}
$$

and

$$
\{2(a+b)+N, N\}=-i^{N-1}\{2 N(a+b)\}
$$

we have

$$
\begin{aligned}
& \frac{q^{-t_{a}-t_{b}}\{2 a+N, N-1\}}{\{2(a+b)+N, N\}} \sum_{k=0}^{N-1}\left\{2(a+b-k)+1\right\} q^{t_{a+b-k}} \mathrm{ADO}_{N}(\ldots \xrightarrow{a} \ldots) \\
& =q^{(2 a+1-N)(2 b+1-N)-N^{2}}\{2 a+N, N-1\} \frac{\{2 N(a+b)\}}{-i^{N-1}\{2 N(a+b)\}} \\
& =\frac{(-1)^{N-1}}{i^{N-1}} q^{(2 a+1-N)(2 b+1-N)}\{2 a+N, N-1\} \\
& =i^{N-1} q^{(2 a+1-N)(2 b+1-N)}\{2 a+N, N-1\}
\end{aligned}
$$

and we get $(32)$.
