A.4. Symmetry. Here we introduce the notion of symmetry for a function defined on the set $\{0,1,2, \cdots, N-1\}$.
Definition A.2. A function $f$ defined on $\{0,1,2, \cdots, N-1\}$ is called symmetric if $f(k)=f(N-1-k)$, and is called anti-symmetric if $f(k)=$ $-f(N-1-k)$.

Lemma A.4. Let

$$
\xi_{N}(k, l, s)=\frac{\{s\}^{2}}{\{s-k\}^{2}}\left\{s-l\right\}^{2}\{k+l-s\}^{2}
$$

Then it satisfies

$$
\begin{aligned}
\xi_{N}(k, l, s)=\xi_{N}(N-1- & k, l, N-1-s+l)=\xi_{N}(k, N-1-l, N-1-s+k) \\
& =\xi_{N}(N-1-k, N-1-l, N-1-k-l+s)
\end{aligned}
$$

Proof. We have

$$
\begin{aligned}
\xi_{N}(N-k, l, N-1-s+ & l)=\frac{\{N-1-s+l\}^{2}}{\{k+l-s\}^{2}\{N-1-s\}^{2}\{s-k\}^{2}} \\
& =\frac{\{s\}^{2}}{\{s-l\}^{2}}\{k+l-s\}^{2}\{s-k\}^{2}}=\xi_{N}(k, l, s)
\end{aligned}
$$

Similarly, we have

$$
\begin{aligned}
